const App = () => {
  return (
    <Router>
      <div className='app-container'>
        <Header />
        <Routes>
          <Route path='/about'>
            <About />
          </Route>
          <Route path='/signup'>
            <LoginSignup />
          </Route>
        </Routes>
      </div>
    </Router>
  );
};

export default App;



